import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import  isLogged  from './isLogged';

const PrivateRoute = ({component: Component}) => {
    return (
        <Route render={props => (
            isLogged() ?
                <Component {...props} />
            : <Redirect to="/login" />
        )} />
    );
};

export default PrivateRoute;
